    const docUrl = 'share-api/BJYW00092995-1vuh9kSZ.csv';
    const buffer = await awsService.download(docUrl, 'ftl-oms-staging');
    const dataGridService = new ParserUtils();
    const parcelRelationSet = dataGridService.parse(buffer, {
      header: true,
      delimiter: ';',
      skipEmptyLines: true,
      typing: true,
    });
    parcelRelationSet.forEach(parcelRelation => (parcelRelation.docUrl = docUrl));
