  function buildTargetKey(sourceKey) {
    const array = sourceKey.split('/');
    const fileName = array && array[array.length - 1];
    return `label/test/COLISSIMO/${fileName}`;
  }

  async function copyTo(sourceKey, targetKey) {
    const result = await awsService.copyObject({
      targetBucket: 'ftl-oms',
      targetPath: targetKey,
      sourcePath: sourceKey,
      sourceBucket: 'ftl-oms',
    });
    console.log(JSON.stringify(result));
  }

  function buildAccessPath(hostDomain, targetKey) {
    return hostDomain + targetKey.replace('label/', '');
  }
